import React from 'react';
import { ScrollView, Text, View,Image,StyleSheet,ImageBackground  } from 'react-native';
import Header from './src/Header';
import Login from './src/Login';
import Toptab from './src/Toptab';


const App = () => {
  return (
    <View style={styles.container}>
        <View>
      <Header/>
    </View>
    <ImageBackground source={require('./src/bg.png')} style={styles.image}>
      {/* <Text style={styles.text}>Inside</Text> */}

    <View>
    <ScrollView>



   <View>
     <Login/>
     <Text  style={{color:'#fff', alignSelf:'flex-end',marginRight:'6%',fontSize:'19px'}} >
  <a href="https://www.w3schools.com/">New to SHOPMIX+ create an account</a>
{/* <Toptab/> */}
     </Text>
   </View>
   <Image
        source={require('./src/splash.png')}
      />
   </ScrollView>

    </View>
    </ImageBackground>
  </View>

  )
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column"
  },
  image: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center"
  },
  text: {
    color: "grey",
    fontSize: 30,
    fontWeight: "bold"
  }
});

export default App;
